import Header from './Header'
import Button from '@material-ui/core/Button'
import {useState, useEffect} from 'react'

const Home = (props) => {
    const addingPlatform = useState();

    return (
    <div>
        <Header />
        <div>
         <Button variant="contained" color='primary'>Add a platform </Button>
         {addingPlatform && <input type='text'></input>}
         <Button variant="contained" color='primary'>Platform 1 </Button>
         <Button variant="contained" color='primary'>Platform 2 </Button>
         <Button variant="contained" color='primary'>Platform 3 </Button>
         </div>
    </div>)
}

export default Home;
